import React from 'react';
import logo from './logo.svg';
import './App.css';

var test = 600;


function App() {
  function changetest() {
    e.preventDefault();
    test += 3;
    console.log('The link was clicked.');
  }

  return (
    <div className="App">
      <header className="Total-header">
        <p>
            Total case:<br />
            {test}
        </p>
      </header>
      <header className="List-header">
        <p>
            France: 30<br />
            Italie: 30<br />
            Allemagne: 30<br />
        </p>
      </header>
      <header className="Map-header">
        <p>
            Ceci est une <br/>
            carte <br/>
            SI SI C UNE CARTE FRERO
        </p>
        <button onClick={changetest}>
          Activate Lasers
        </button>
      </header>
    </div>
  );
}

export default App;
